import React from "react";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";

const SubjectsCard = ({ key, id, subjectName, mark }) => {
  function selectImg(subjectName) {
    if (subjectName === "romana")
      return "https://www.championtutor.com/blog/wp-content/uploads/2017/11/When-to-Get-a-Maths-Tutor-for-Your-Child.jpg";
    else return "https://clipartcraft.com/images/math-clipart-word-5.png";
  }

  return (
    <Card className="SubjectsCard">
      <Card.Img
        className="SubjectsCardImg"
        variant="top"
        src={selectImg()}
        alt={"image " + subjectName}
      />
      <Card.Body>
        <Card.Title>
          <p>Subject name: {subjectName}</p>
        </Card.Title>
        <Card.Text>Mark: {mark}</Card.Text>
        <Button variant="primary">Edit Mark</Button>
        <Button variant="danger">Delete Subject</Button>
      </Card.Body>
    </Card>
  );
};

export default SubjectsCard;
